import headerLogo from "../../images/Logo.svg";
import { ButtonAnchor, Container, Logo, Title } from "./Header.styled";

const Header = () => {
  return (
    <Container>
      <Logo src={headerLogo} alt="header-logo" />
      <Title>TESKTASK</Title>
      <ButtonAnchor href="#users-list">Users</ButtonAnchor>
      <ButtonAnchor href="#sign-in-form">Sign In</ButtonAnchor>
    </Container>
  );
};

export default Header;
